import React from 'react'
import login_bg from "../Images/login_bg.webp";

export const Register = () => {
    let style1 = {
        height: "40vh",
        width: "60vw"
    }
    return (
        <div>
            <img src={login_bg} alt="background" style={style1} />
        </div>
    )
}
